import Image from 'next/image'
import { bgWrap, bgText } from '../styles.module.css'

const Background = () => (
  <div>
    <div className={bgWrap}>
      <Image
        alt="cairn"
        src="/cairn.jpg"
        layout="fill"
        objectFit="cover"
        quality={100}
      // src="/cairn.jpg"
      // alt="cairn"
      // width={5755}
      // height={3826}

      />
    </div>
    <p className={bgText}>
      Jillian Gibson
      <br />
      Software Engineer
    </p>
  </div>
)

export default Background
